import React from 'react'
import { Link } from 'react-router-dom';
import { Member, BodyCard } from "./equipElement"

function Card({equipes}) {
    
    return (
        <BodyCard>
            {equipes.map((item, index) => (
                <Member key={index}>
                <img src={item.photo}/>
                <div className="content">
                    <h5>{item.name}</h5>
                    <ul className="socialNet">
                        {item.socialnetwork.map((net, index) =>(
                            <li key={index}>
                                <Link to={net.link}>
                                    <img src={net.icon}/>
                                </Link>
                            </li>
                        ))
                        }
                    </ul>
                </div> 
            </Member>
            ))

            }
        </BodyCard>
    )
}

export default Card
